const getTempChartFromDex = (minTime) => {
    const result = [];

    data.bars.forEach(bar => {
        const { close, high, low, open, timestamp } = bar;
        if (moment(timestamp) > moment(minTime, 'DD/MM/YYYY')) {
            result.push({
                x: new Date(Number(timestamp)),
                y: [Number(open), Number(high), Number(low), Number(close)]
            });
        }
    })

    return result;
};

export default getTempChartFromDex;
